import React from 'react';
import "./style.css";

function Nav() {
  return (


<Nav fill variant="tabs" defaultActiveKey="/signin">

  <Nav.Item>
    <Nav.Link href="/home">MESSIER</Nav.Link>
  </Nav.Item>

  <Nav.Item>
    <Nav.Link eventKey="link-1">JOURNAL</Nav.Link>
  </Nav.Item>

  <Nav.Item>
    <Nav.Link eventKey="link-2">MOOD</Nav.Link>
  </Nav.Item>

  <Nav.Item>
    <Nav.Link eventKey="link-3">ACCOUNT</Nav.Link>
  </Nav.Item>
</Nav>

);
}

export default Nav;

